// api.js

import axios from 'axios';

// Example GET request
export const getUserImages = (userId) => {
  return axios.get(`https://cohesive-vine-437901-v1.uc.r.appspot.com/get_images?user_id=${userId}`);
};


// Example POST request
export const uploadFiles = async (data) => {
  try {
    const response = await axios.post('https://cohesive-vine-437901-v1.uc.r.appspot.com/upload_image', data);
    return response.data;
  } catch (error) {
    console.error('Error posting data:', error);
    throw error;
  }
};
